import craft from "./images/craft.jpg"

const productsData = [
    {
        image: {craft},
        title: "first title",
        description: "first description",
        id: 1,
        price: 5.99
    },
    {
        image: {craft},
        title: "second title",
        description: "second description",
        id: 2,
        price: 12.99
    },
    {
        image: {craft},
        title: "third title",
        description: "third description",
        id: 3,
        price: 24.99
    },
    {
        image: {craft},
        title: "fourth title",
        description: "fourth description",
        id: 4,
        price: 8.99
    },
    {
        image: {craft},
        title: "fifth title",
        description: "fifth description",
        id: 5,
        price: 34.99
    },
    {
        image: {craft},
        title: "sixth title",
        description: "sixth description",
        id: 6,
        price: 5.99
    }
]

export { productsData }
